create table rice_production
(
    "Domain Code"      text,
    "Domain"           text,
    "Area Code"        integer,
    "Area"             text,
    "Element Code"     integer,
    "Element"          text,
    "Item Code"        integer,
    "Item"             text,
    "Year Code"        integer,
    "Year"             integer,
    "Unit"             text,
    "Value"            integer,
    "Flag"             text,
    "Flag Description" text
);

alter table rice_production
    owner to ge_docker;

create table titanic
(
    "Name"     text,
    "PClass"   text,
    "Age"      text,
    "Sex"      text,
    "Survived" integer,
    "SexCode"  integer
);

alter table titanic
    owner to ge_docker;

